import {Link, Route} from "react-router-dom";
import Column from "../components/table";

export const Routes = () => {
    return (
        <>
            <Route path="/loop1">
                <Column titles={
                    [
                        {
                            title: "console",
                            fields: [
                                {
                                    response: 2
                                },
                                {
                                    response: 2
                                },
                                {
                                    response: 2
                                },
                                {
                                    response: 2
                                },
                            ]
                        }
                    ]
                } />
            </Route>
            <Route path="/loop2">
            </Route>
            <Route path="/loop3">
            </Route>
            <Route path="/loop4">
            </Route>
            <Route path="/loop5">
            </Route>
        </>

    )
}

export const Links = () => {
    return (
        <>
            <Link to="/loop1">
                <button>1</button>
            </Link>
            <Link to="/loop2">
                <button>2</button>
            </Link>
            <Link to="/loop3">
                <button>3</button>
            </Link>
            <Link to="/loop4">
                <button>4</button>
            </Link>
            <Link to="/loop5">
                <button>5</button>
            </Link>
        </>
    )
}
